func contentEquals(s1, s2 [][]string) bool {
	if len(s1) != len(s2) {
		return false
	}
	strings1, strings2 := make([][]string, len(s1)), make([][]string, len(s2))
	copy(strings1, s1)
	copy(strings2, s2)

	for a := 0; a < len(strings1); a++ {
		sort.Slice(strings1[a], func(i, j int) bool {
			return strings1[a][i] < strings1[a][j]
		})
	}
	for a := 0; a < len(strings2); a++ {
		sort.Slice(strings2[a], func(i, j int) bool {
			return strings2[a][i] < strings2[a][j]
		})
	}
	sort.Slice(strings1, func(i, j int) bool {
		return len(strings1) == 0 || strings1[i][0] < strings1[j][0]
	})
	sort.Slice(strings2, func(i, j int) bool {
		return len(strings2) == 0 || strings2[i][0] < strings2[j][0]
	})

	for i := 0; i < len(strings1); i++ {
		if !reflect.DeepEqual(strings1[i], strings2[i]) {
			return false
		}
	}
	return true
}
